import styles from './Artificial.module.scss';

const Page = ({}) => {
    return (
        <>
            <Nav />
        </>
    );
};

const Nav = ({}) => <Container>Hello</Container>;

const Container = ({ children }) => (
    <div className={styles['container']}>{children}</div>
);

export default Page;
